// Variables
// - - - - - - - - - - - - - - - - - - - - - - - - -

// Fichier de configuration
// C'est ici que les variables principales seront stockées

var smallBreackPoints  = 640,
	mediumBreackPoints = 1024;

var smallUp 	= window.matchMedia("(min-width: " + smallBreackPoints + "px)").matches,
	smallOnly   = window.matchMedia("(max-width: " + smallBreackPoints + "px").matches,
	smallMedium = window.matchMedia("(max-width: " + mediumBreackPoints + "px)").matches,
	mediumUp    = window.matchMedia("(min-width: " + smallBreackPoints + "px)").matches,
	mediumOnly  = window.matchMedia("(min-width: " + smallBreackPoints + "px) and (max-width: " + mediumBreackPoints + "px").matches,
	largeUp     = window.matchMedia("(min-width: " + mediumBreackPoints + "px)").matches;


// Variables globales
// - - - - - - - - - - - -

var header = Foundation.utils.S('#l-header'),
    navigation = Foundation.utils.S('#l-navigation'),
    navigationLabel = Foundation.utils.S('#l-navigation > li > label'),
    subMenu = Foundation.utils.S('#l-submenu'),
    navigationMobile = Foundation.utils.S('#l-navigation-mobile'),
    navigationMobileLabel = Foundation.utils.S('#l-navigation-mobile > li > label'),
    content = Foundation.utils.S('#l-content'),
    container = Foundation.utils.S('#l-container'),
    footer = Foundation.utils.S('#l-footer'),
    offCanvasWrap = Foundation.utils.S('#off-canvas-wrap');



// State
// - - - - - - - - - - - -

var hideClass = 'is-hidden',
    activeClass = 'active';
// Function
// - - - - - - - - - - - - - - - - - - - - - - - - -

// Format du numéro
// - - - - - - - - - - - -

// /!\ type text
// Fonction qui change le format de sortie
function numberFormatText($elem) {
	var value  = id.text(),
        result = value.replace(/(\d)(?=(\d{3})+$)/g, '$1 ');

    $elem.text(result);
};


// /!\ type input
// Changement du format sur une valeur
function numberFormatValue($elem) {
	var value  = id.val(),
        result = value.replace(/(\d)(?=(\d{3})+$)/g, '$1 ');

    $elem.val(result);
};
// Navigation
// - - - - - - - - - - - - - - - - - - - - - - - - -

function showSubMenu($nav) {

    $nav.on('click', function(event){
        
        var element = Foundation.utils.S(this),
            ul      = element.next('ul'),
            count   = ul.length;

        // On ouvre notre sous-menu
        Foundation.utils.S('.submenu').slideUp('fast');

        // Si un autre sous-menu est ouvert
        if (count > 0 && !ul.is(':visible')) {

            // Alors on le ferme
            ul.slideDown('fast');
            event.preventDefault();
        }

        else {
            ul.slideUp('fast');
        }

        // On detect si le label possède la classe 'active'
        if (Foundation.utils.S(this).hasClass(activeClass)) {
            Foundation.utils.S(this).removeClass(activeClass);
        }

        else {
            $nav.find(activeClass).removeClass(activeClass);
            Foundation.utils.S(this).addClass(activeClass);
        }

    });

};




// Navigation
// - - - - - - - - - - - - - - - - - - - - - - - - -

function mainNavigation() {


    // Mobile
    // - - - - - - - - - - - -
//    showSubMenu(navigationMobileLabel);



    // Principale
    // - - - - - - - - - - - -

    // Fermeture du sous-menu si on clic à l'exterieur
    // 1. Si le clic n'est pas sur la navigation
    // 2. Alors on cache le sous-menu

    Foundation.utils.S(document.body).click(function(e) {

        if (!Foundation.utils.S(e.target).is(navigation) && !$.contains(navigation[0], e.target)) { // 1

            navigation.find('.submenu').slideUp(); // 2

        };

    });
    
};

